import React from 'react';
import styled from 'styled-components';
import { NavLink } from 'react-router-dom';
import { colors } from '../utilities';
import { DownloadButton } from '../elements/Button';
import Download from '../elements/svg/Download';


const NegocioCatalogoBase = ({className}) => {
    return (
        <div className={className}>
            <div className="catalog">
                <div className="text">
                    <p className="txt-catalog">Da click en el botón para descargar nuestro catálogo.</p>
                </div>
                <NavLink 
                    className="nav_link" 
                    exact to={`/descargarcatalogo`}>     
                    <DownloadButton className="catalog-button">
                        <Download className="icon" size={45}/>
                    </DownloadButton>

                </NavLink>

            </div>

        </div>
    );
};

const NegocioCatalogo = styled(NegocioCatalogoBase)`
    position: relative;
    width: 100%;
    margin-top: 8rem;


    .text{
        display: inline-block;
        margin-top: 2.5rem;
        margin-left: 1rem;
    }


    .catalog{
        width: 95%;
        height: 5rem;
        margin: 0.5rem 0 2.5rem 11rem;
    }


    .txt-catalog{
        color: ${colors.white_1};
        font-size: 1.5rem;
        // margin: 0 0 0 0.5rem;
        line-height: 2.5rem;
        padding-bottom: 0.7rem;
    }

    .catalog-button{
        margin-left: 13rem;

    }





`



export default NegocioCatalogo;
